@import url("https://fonts.googleapis.com/css2?family=Raleway:ital,wght@0,200;1,200&display=swap");

.w_card {
  background-color: white;
  width: 25rem;
  height: 25rem;
}
.w_info {
  width: 100%;
  height: 55%;
}

html,
body {
  font-family: "Raleway", sans-serif;
  background: rgb(0, 255, 184);
  background: -moz-linear-gradient(
    135deg,
    rgba(0, 255, 184, 1) 0%,
    rgba(0, 164, 255, 1) 100%
  );
  background: -webkit-linear-gradient(
    135deg,
    rgba(0, 255, 184, 1) 0%,
    rgba(0, 164, 255, 1) 100%
  );
  background: linear-gradient(
    135deg,
    rgba(0, 255, 184, 1) 0%,
    rgba(0, 164, 255, 1) 100%
  );
  filter: progid:DXImageTransform.Microsoft.gradient(startColorstr="#00ffb8",endColorstr="#00a4ff",GradientType=1);
}
